import React from "react";
import "./UICrearColaborador.css";

export default function InterfazCrearColaborador() {
    return (
        <div className="App-Crear-Colaborador">
            <form>
            <a>Formulario para creacion de colaboradores</a>
            
            <div className="form-group">
            <input type="text" name="nombre" placeholder="Ingrese el nombre del empleado..."/>
            <input type="text" name="nombre" placeholder="Ingrese el apellido del empleado..."/>
            </div>
            
            </form>
        </div>
    );
}
